Here is a simple JavaScript program that generates ASCII characters from 0x00 (NUL) to 0x7F (DEL):

```javascript
for(let i = 0; i <= 127; i++){
    let asciiChar = String.fromCharCode(i);
    console.log("ASCII Code: " + i + ", ASCII Character: '" + asciiChar + "'");
}
```
This program uses a for loop to iterate over the numbers 0 through 127 (inclusive). For each number, it converts that number into an ASCII character using `String.fromCharCode()` and then logs both the ASCII code and its corresponding ASCII character.
